plt.contour(xx, yy, Z_vals, levels=[-1, 1], colors='black', linestyles='dashed', linewidths=1, label="Slab Boundaries")

plt.xlabel("Feature 1")
plt.ylabel("Feature 2")
plt.title("Support Vector Classifier with γ = 2")
